SET standard_conforming_strings = OFF;
DROP TABLE IF EXISTS "public"."countries" CASCADE;
DELETE FROM geometry_columns WHERE f_table_name = 'countries' AND f_table_schema = 'public';
BEGIN;
CREATE TABLE "public"."countries" ( "ogc_fid" SERIAL, CONSTRAINT "countries_pk" PRIMARY KEY ("ogc_fid") );
SELECT AddGeometryColumn('public','countries','wkb_geometry',3857,'MULTIPOLYGON',2);
CREATE INDEX "countries_wkb_geometry_geom_idx" ON "public"."countries" USING GIST ("wkb_geometry");
ALTER TABLE "public"."countries" ADD COLUMN "name" VARCHAR(24);
COMMIT;
